  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0109921 includes biological,
  chemical, discrete sample, physical and profile data collected from RYOFU MARU in
  the North Pacific Ocean, Philippine Sea and South Pacific Ocean from 2010-07-06
  to 2010-08-22 and retrieved during cruise CLIVAR_P09_2010 and RF10-05. These data
  include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE,
  NITRATE, NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD and bottle. These data were collected by Hitomi Kamiya and Toshiya Nakano of
  Japan Meteorological Agency; Pollutants Chemical Analysis Center; Marine Division;
  Global Environment and Marine Depertment and Masao Ishii of Meteorological Research
  Institute; Geochemical Research Department as part of the CLIVAR_P09_2010 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
